n remove option of card section\n    Then payment details should be removed\n\n  #@AddAddress\n  Scenario: Verify User can add an Address\n    When User click on Account option\n    And User click on Add address option\n    And user fill new address form with below information\n      | country     | fullName | phoneNumber | streetAddress       | apt   | city       | state | zipCode |\n      | Afghanistan | Israr    |  7579545345 | 797 Shar-E-Naw road | 777 A | Shar-E-Naw | Kabul |   19078 |\n    And User click Add Your Address button\n    Then a message should be displayed 'Address Added Successfully'\n\n  #@UpdateAddress\n  Scenario: Verify User can edit an Address added on account\n    When User click on Account option\n    And User click on edit address option\n    And user fill new address form with below information\n      | country     | fullName    | phoneNumber | streetAddress     | apt   | city       | state | zipCode |\n      | Afghanistan | Israr Ahmed |  7579545340 | 500 Kabul Kingdom | 500 A | Shar-e-naw | Kabul |   99077 |\n    And User click update Your Address button\n    Then a message should be displayed 'Address Updated Successfully'\n\n  #@RemoveAddress\n  Scenario: Verify User can remove Address from Account\n    When User click on Account option\n    And User click on remove option of Address section\n    Then Address details should be removed\n","mediaType":"text/x.cucumber.gherkin+plain"}},{"gherkinDocument":{"uri":"classpath:features/RetailAccount.feature","feature":{"location":{"line":2,"column":1},"tags":[{"location":{"line":1,"column":1},"name":"@Regression","id":"80953d20-a0c2-4a48-bc19-e44fe4d7bff7"}],"language":"en","keyword":"Feature","name":"Retail Account Page","description":"","children":[{"background":{"location":{"line":4,"column":3},"keyword":"Background","name":"","description":"","steps":[{"location":{"line":5,"column":5},"keyword":"Given ","keywordType":"Context","text":"User is on retail website","id":"a1f4208e-046c-499b-bec    Given User is on retail website\n    When User click on Sign in option\n    And User enter email 'israr07@tekschool.us' and password 'Tek@12345'\n    And User click on login button\n    And User should be logged in into Account\n\n  #@OrderTest\n  Scenario: Verify User can add an item to cart\n    And User change the category to 'Smart Home'\n    And User search for an item 'kasa outdoor smart plug'\n    And User click on Search icon\n    And User click on item\n    And User select quantity '2'\n    And User click add to Cart button\n    Then the cart icon quantity should change to '2'\n\n  #@OrderPlacing\n  Scenario: Verify User can place an order with Shipping address and payment Method on file\n    And User change the category to 'Electronics'\n    And User search for an item 'Apex Legends'\n    And User click on Search icon\n    And User click on item\n    And User select quantity '5'\n    And User click add to Cart button\n    Then the cart icon quantity should change to '5'\n    And User click on Cart option\n    And User click on Proceed to Checkout button\n    And User click on Place Your Order\n    Then a message should be displayed 'Order Placed, Thanks'\n\n  #@CancelOrder\n  Scenario: Verify User can cancel the order\n    And User click on Orders section\n    And User click on first order in list\n    And User click on Cancel The Order button\n    And User select the cancelation Reason 'Bought wrong item'\n    And User click on Cancel Order button\n    Then a cancelation message should be displayed 'Your Order Has Been Cancelled'\n\n  #@ReturnOrder\n  Scenario: Verify User can Return the order\n    And User click on Orders section\n    And User click on first order in list\n    And User click on Return Items button\n    And User select the Return Reason 'Item damaged'\n    And User select the drop off service 'FedEx'\n    And User click on Return Order button\n    Then a cancelation message should be displayed 'Return was successfull’\n\t\n\t#@ReviewOrder\n  Scenario: Verify User can write a review on order placed\n    And User click on Orders section\n    And User click on first order in list\n    And User click on Review button\n    And User write Review headline 'headline value' and 'review text'\n    And User click Add your Review button\n    Then a review message should be displayed 'Your review was added successfully'\n","mediaType":"text/x.cucumber.gherkin+plain"}},{"gherkinDocument":{"uri":"classpath:features/RetailOrder.feature","feature":{"location":{"line":2,"column":1},"tags":[{"location":{"line":1,"column":1},"name":"@Regression","id":"1399da03-ba9c-4857-a1ab-00961ef76db8"}],"language":"en","keyword":"Feature","name":"Retail Order Page","description":"","children":[{"background":{"location":{"line":4,"column":3},"keyword":"Background","name":"","description":"","steps":[{"location":{"line":5,"column":5},"keyword":"Given ","keywordType":"Context","text":"User is on retail website","id":"bfdf9d09-c51f-4a39-b1c4-a79fdf5e964d"},{"location":{"line":6,"column":5},"keyword":"When ","keywordType":"Action","text":"User click on Sign in option","id":"1d4161f2-dbc4-4fcd-afe0-e3181454e6df"},{"location":{"line":7,"column":5},"keyword":"And ","keywordType":"Conjunction","text":"User enter email 'israr07@tekschool.us' and password 'Tek@12345'","id":"cfc9a41d-d74b-4985-8f77-0060cb645f4b"},{"location":{"line":8,"column":5},"keyword":"And ","keywordType":"Conjunction","text":"User click on login button","id":"12a30ead-a002-47b8-9306-fef728455b5b"},{"location":{"line":9,"column":5},"keyword":"And ","keywordType":"Conjunction","text":"User should be logged in into Account","id":"5ede1c30-0437-4ba0-ab3e-8aad9be7959b"}],"id":"313f2859-5aaf-4883-b9d8-0337909abf87"}},{"scenario":{"location":{"line":12,"column":3},"tags":[],"keyword":"Scenario","name":"Verify User can add an item to cart","description":"","steps":[{"location":{"line":13,"column":5},"keyword":"And ","keywordType":"Conjunction","text":"User change the category
